class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        
        O(n^2) 复杂度
        """
        maxstr, tmpstr = [], []
        for j in range(len(s)):
            for i in s[j:]:
                if i not in tmpstr:
                    tmpstr.append(i)
                elif i in tmpstr:
                    maxstr = maxstr if len(maxstr) >= len(tmpstr) else tmpstr
                    tmpstr = [i]
            maxstr = maxstr if len(maxstr) > len(tmpstr) else tmpstr
            tmpstr = []
        print(maxstr)
        return len(maxstr)


